import { connect } from 'react-redux'
import { setFavorites, initCollaborator, setCollaborator } from './actions'
import FavoriteList from './FavoriteList'

const mapStateToProps = (state, ownProps) => ({
  user: state.loggedinUser,
  favorites: state.favorites
})

const mapDispatchToProps = (dispatch, ownProps) => ({
  setFavorites: (payload) => dispatch(setFavorites(payload)),
  initCollaborator: (payload) => dispatch(initCollaborator(payload)),
  setCollaborator: (payload) => dispatch(setCollaborator(payload))
})

export default connect(
  mapStateToProps,
  mapDispatchToProps
)(FavoriteList)
